	(5715, 0, NULL, NULL, 'Es ist toll der König zu sein! Nun, lasst uns auf das zurückkommen was Ihr gerade sagen wolltet...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
