	(6162, 0, NULL, NULL, 'Ich brauche einen Flug.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6182, 0, NULL, NULL, 'Silas, warum ist alles auf dem Jahrmarkt umsonst? Macht Ihr überhaupt einen Gewinn?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6183, 0, NULL, NULL, 'Ich möchte ein wenig Eure Ware betrachten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6185, 0, NULL, NULL, 'Ich töte den Mann auf der Stelle, wie mein Lehnsherr es von mir erwartet, denn der Kerl ist ein Dieb und ein Lügner zugleich.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6185, 1, NULL, NULL, 'Ich bringe den Mann zu meinem Lehnsherrn für seine Bestrafung, da er das Gesetz gebrochen hat, und es meine beeidete Pflicht ist, das Gesetz zu wahren.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6185, 2, NULL, NULL, 'Ich konfisziere das Getreide, das er stahl, warne ihn, das Stehlen der Weg zur Verdammnis und Zerstörung ist, aber lasse ihn letztendlich zu seiner Familie zurückkehren.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6185, 3, NULL, NULL, 'Ich erlaube dem Mann genug Getreide für seine Familie mitzunehmen, damit er sie für ein paar Tage ernähren kann und ermutige ihn, das Land zu verlassen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6186, 0, NULL, NULL, 'Ich bin bereit zu erfahren, was das Schicksal für mich bereithält!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6187, 0, NULL, NULL, 'Entsprechend der Order meines Herrn, werde ich ihn hinrichten. Er wird bis zum letzten Atemzug endlose Schmerzen erleiden. So werden ich ihm die Taten an meinem Volk heimzahlen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6187, 1, NULL, NULL, 'Entsprechend der Order meines Herrn werde ich ihn hinrichten, doch werde ich es auf eine möglich schmerzfreie Art tun. Zwar muss der Gerechtigkeit genüge getan werden, doch soll dies mein Mitleid nicht mindern.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6187, 2, NULL, NULL, 'Ich riskiere mein Leben und befreihe ihn, damit er seine Unschuld beweisen kann. Soweit ich es kann, unterstütze ich ihn auf jede erdenkliche Art und Weise.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6202, 0, NULL, NULL, 'Ich möchte ein wenig Eure Ware betrachten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6202, 1, NULL, NULL, 'Erzählt mir mehr von diesen Dunkelmond-Karten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 0, NULL, NULL, 'Erzählt mir mehr über das Bestienkartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 1, NULL, NULL, 'Erzählt mir mehr über das Portalkartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 2, NULL, NULL, 'Erzählt mir mehr über das Elementarkartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 3, NULL, NULL, 'Erzählt mir mehr über das Kriegsfürstenkartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 4, NULL, NULL, 'Erzählt mir mehr über das Furienkartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 5, NULL, NULL, 'Erzählt mir mehr über das Deliriumkartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 6, NULL, NULL, 'Erzählt mir mehr über das Segenskartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 7, NULL, NULL, 'Erzählt mir mehr über das Sturmkartenset.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6207, 8, NULL, NULL, 'Existieren weitere Kartensets?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6208, 0, NULL, NULL, 'Ich konfrontiere den Herrscher mit seinem unangebrachten Verhalten und bewahre so die Ehre meines Lehensherrn, mit der Gefahr zukünftige diplomatische Verhandlungen unmöglich zu machen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6208, 1, NULL, NULL, 'Ich nehme die Beleidigung hin und versuche dem Herrscher unterschwellig klar zu machen, dass er sich einen unentschuldbaren diplomatischen Ausrutscher geleistet hat. Anschließend werde ich bei meiner Rückkehr, meinen Lehensherrn über dieses Vorkommnis unterrichten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6208, 2, NULL, NULL, 'Ich nehme die Beleidigung stillschweigend hin und werde meinen Lehensherrn nichts davon berichten, schließlich soll ich um jeden Preis Frieden schaffen. Es ist immerhin nur eine Beleidigung und keine Kriegserklärung.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6209, 0, NULL, NULL, 'Ich würde mich gegen die Aufnahme meines Bruders in den Orden aussprechen und einen permanenten Bruch unserer Beziehung zueinander riskieren. Er wäre eine zu große Gefahr für sich selbst und andere in seinem Umfeld und es wäre ein viel zu großes Risiko darauf zu hoffen, dass er in seine Rolle hineinwachsen würde.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6209, 1, NULL, NULL, 'Ich würde mich für die Aufnahme meines Bruders in den Orden aussprechen und die Gefahr auf mich nehmen, dass die Sicherheit des Ordens gefährdet wäre. Ich vertraue seiner Fähigkeit sich anzupassen und sein Wissen zu erweitern und könnte ihm helfen in seine Rolle hineinzuwachsen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6209, 2, NULL, NULL, 'Ich würde heimlich Gerüchte streuen, die gegen die Aufnahme meines Bruders in den Orden sprechen. So verhindere ich seine Mitgliedschaft und rette unsere Familienbande.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6210, 0, NULL, NULL, 'Ich würde meinem Lehensherrn das Ohr des Monsters bringen, um dessen Tod für mich zu beanspruchen und die Belohnung an mich nehmen. Es ist falsch eine Tat für sich zu beanspruchen, die in Wirklichkeit ein Anderer vollbracht hat.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6210, 1, NULL, NULL, 'Ich würde meinem Lehensherrn das Ohr des Monsters bringen, um dessen Tod für mich zu beanspruchen - immerhin wurde es durch meine Hand getötet. Anschließend würde ich dem Ritter einen Teil der Belohnung abgeben, damit er der mittellosen Familie helfen kann.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6210, 2, NULL, NULL, 'Ich erzähle niemanden von meiner heldenhaften Tat und erlaube dem Ritter die Belohnung für sich zu beanspruchen, damit er der mittellosen Familie helfen kann.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(6211, 0, NULL, NULL, 'Ich habe ausreichend Platz in meinem Gepäck und würde gerne eines dieser Horoskope haben, von denen Ihr mir erzählt habt!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
